import React from 'react';
const getStyle = (selected) => (selected ? { 'background-color': 'red' } : { 'background-color': 'blue' })

const Marker = ({ name, coordinates, onClick, active} ) => (
	<div onClick={onClick} 
		 style={{backgroundColor: active ? 'red' : 'none' }}
	>
		{name}<br/>
		{coordinates}
	</div>
)
